import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet
} from "react-router-dom";
import Login from "./Components/Login";
import Sidebar from "./Components/Sidebar";
import Teacher from "./Components/Teacher";
import Home from "./Components/Home";
import Student from "./Components/Student";
import "../src/Css/Header.css"
import "../src/Css/Student.css"
import "../src/Css/Teacher.css"
import "../src/Css/Home.css"
import "../src/Css/Batch.css"
import TeacherForm from "./Components/TeacherForm";
import TeacherView from "./Components/TeacherView";
import StudentView from "./Components/StudentView";
import StudentForm from "./Components/StudentForm";
import Batch from "./Components/Batches";
import AddBatch from "./Components/AddBatch";
import ChildComp from "./BindingDemos/ParentComp";
import PropsDemo from "./BindingDemos/PropsDemo";
// import "../src/Components/cross"

const MainLayout = () => {
  return (
    <>
      <Sidebar />
      <Outlet />
    </>
  )
}

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route element={<MainLayout />}>
            <Route path="/Teacher" element={<Teacher />} />
            <Route path="/TeacherForm" element={<TeacherForm />} />
            <Route path="/TeacherView" element={<TeacherView />} />
            <Route path="/StudentView" element={<StudentView />} />
            <Route path="/StudentForm" element={<StudentForm />} />
            <Route path="/Batch" element={<Batch />} />
            <Route path="/AddBatch" element={<AddBatch />} />
            <Route path="/Home" element={<Home />} />
            <Route path="/Student" element={<Student />} />
            <Route path="/Ras" element={<PropsDemo technology="React"/>} />

          </Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
